from collections import defaultdict


class Solution(object):
    def check(self, char_count):
        for _, v in char_count.items():
            if v != 0:
                return False
        return True

    def checkInclusion(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        m = len(s1)
        n = len(s2)
        if m == 0:
            return True
        if m > n:
            return False
        char_count = defaultdict(lambda: 0)
        for i in range(m):
            char_count[s1[i]] += 1
            char_count[s2[i]] -= 1
        if self.check(char_count):
            return True
        for i in range(m, n):
            char_count[s2[i]] -= 1
            char_count[s2[i-m]] += 1
            if self.check(char_count):
                return True
        return False


s = Solution()
print(s.checkInclusion("", ""))

